import React from "react";
import { Route } from "react-router-dom";
import collectionsOverview from "components/collection-overview";

const ShopPage = ({ match }) => {
  return (
    <div className="shop-page">
      <Route></Route>
      <collectionsOverview />
    </div>
  );
};

export default ShopPage;
